  const { user } = useAuthContext();
  useEffect(() => {
    console.log(user);
    axios
      .get("/api/users/findOne", {
        params: {
          ...user,
        },
      })
      .then((usuarios) => console.log(usuarios.data.amigos));
  }, []);

  return (
    <>
      <div>UsersFriendsContent</div>;
    </>
  );
}
